const prompts = $input.first().json.prompts || [];

const urls = prompts.flatMap(p => p.answer?.links || []);

const data = urls
  .filter(Boolean)
  .map(u => u.trim())
  .filter(u => u.startsWith("http"));

return [{ links: data }];

/**
 * Extract prompts with answers (excluding links)
 * Input: SE Ranking AI Search API response
 * Output: Array of { prompt, answer }
 */

const output = [];
const data = $input.first().json
for (const p of data.prompts) {
  if (p.prompt && p.answer?.text) {
    output.push({
      json: {
        prompt: p.prompt.trim(),
        answer: p.answer.text.trim()
      }
    });
  }
}

return { prompts: output}
